import React, {useState, useEffect} from "react";
import NavBar from "./Layout/NavBar";
import {useSelector, useDispatch} from "react-redux";
import history from "../history";

const Settings = () => {

    const dispatch = useDispatch();
    const { auth, errors } = useSelector( state => ({
    auth: state.auth,
    errors: state.errors,
    })); 

    useEffect(()=> {

           if(!auth.isAuthenticated){
            history.push("/");

           }

       });

    return(
        <div>
            <NavBar />
            <br/>
            <br/>
            <br/>
            <br/>
            <br/>
            <br/>
            <div>
                <h1>Settings</h1>
                <br/>
                <br/>
                <h2>Profile</h2>
                <br/>
                <br/>
                <p style={{textAlign: "left", marginLeft: "20px"}}>Name: {auth.user.name}</p>
                <br/>
                <br/>
                <p style={{textAlign: "left", marginLeft: "20px"}}>Id: {auth.user.id}</p>
                <br/>
                <br/>
                <p style={{textAlign: "left", marginLeft: "20px"}}>Email: {auth.user.email}</p> 
                <br/>
                <br/>
                <p style={{textAlign: "left", marginLeft: "20px"}}>Role: {auth.user.role}</p> 

            </div>
            <br/>
            <br/>
            <br/>
            <br/>
            <br/>
            <br/>
            <br/>
            <br/>
        </div>
    )
}

export default Settings;
